// koffee 1.20.0
var ast;

ast = require('./test_utils').ast;

describe('ast', function() {
    it('simple', function() {
        ast('a', 'a');
        ast('1', '1');
        ast('no', 'no');
        return ast('1;2', '1\n2');
    });
    return it('operation', function() {
        ast('a and b', "operation\n  lhs\n    a\n  operator\n    and\n  rhs\n    b");
        ast('1 + 2', "operation\n  lhs\n    1\n  operator\n    +\n  rhs\n    2");
        ast('++a', "operation\n  lhs\n  operator\n    ++\n  rhs\n    a");
        ast('not a', "operation\n  lhs\n  operator\n    not\n  rhs\n    a");
        ast('a = b + 1', "operation\n  lhs\n    a\n  operator\n    =\n  rhs\n    operation\n      lhs\n        b\n      operator\n        +\n      rhs\n        1");
        return ast('a = b = c', "operation\n  lhs\n    a\n  operator\n    =\n  rhs\n    operation\n      lhs\n        b\n      operator\n        =\n      rhs\n        c");
    });
});

